import React from 'react'
import Button from '../../atoms/Button/Button'
import './MovieCard.css'
export default function MovieCard(props){
    return(
        <div className="movie-card-container">
            <p>{props.name}</p>
            <p>{props.year}</p>
            <Button/>
        </div>
    )
}
